* {
  box-sizing: border-box;
  font-size: 1rem;
}

body {
  padding: 0;
  margin: 0;
}

.app {
  max-width: 980px;
  margin: 0 auto;
}

.form {
  display: grid;
  grid-template-columns: 1fr 128px;
  grid-template-rows: 1fr 1fr;
  padding: 1rem;
  gap: 0 1rem;
}
.form .caption {
  grid-column: 1/3;
  font-size: 1.5rem;
}
.form .input {
  border: none;
  border-bottom: 2px solid rgba(0, 0, 0, 0.25);
  outline: none;
  transition: 300ms ease;
}
.form .input:focus {
  border-bottom-color: #199861;
}
.form .btn {
  border-radius: 100px;
  border: 1px solid rgba(0, 0, 0, 0.25);
  background: rgba(0, 0, 0, 0.1);
  outline: none;
}
.form .btn:active {
  background: rgba(25, 152, 97, 0.25);
}

.repos {
  display: grid;
  grid-template-columns: repeat(auto-fit, minmax(256px, 1fr));
  gap: 0.5rem;
  padding: 1rem;
}

.repo {
  display: block;
  padding: 1rem;
  color: #333;
  text-decoration: none;
  overflow: hidden;
  transition: 250ms ease;
  box-shadow: 0 0px 2.5px 0 rgba(0, 0, 0, 0.25);
}
.repo:hover {
  box-shadow: 0 2.5px 5px 0 rgba(0, 0, 0, 0.25);
}
.repo .name {
  margin: 0;
  overflow-wrap: normal;
  word-break: keep-all;
  white-space: nowrap;
}
.repo .info {
  margin: 0;
}
.repo .info [data-lang] {
  display: inline-flex;
  flex-direction: row;
  align-items: center;
}
.repo .info [data-lang]::before {
  content: "";
  display: block;
  width: 1em;
  height: 1em;
  border-radius: 50%;
  background: currentColor;
  margin-right: 0.5em;
}
.repo .info > *:not(:last-child) {
  margin-right: 1em;
}
.repo .info .count::before {
  content: "⭐️";
}

.loading {
  position: absolute;
  top: calc((100% - 100px) / 2);
  left: calc((100% - 100px) / 2);
  width: 100px;
  height: 100px;
  border: 8px solid rgba(0, 0, 0, 0.25);
  border-top-color: transparent;
  border-radius: 50%;
  animation: spinner 1s linear infinite;
}
@keyframes spinner {
  to {
    transform: rotate(0deg);
  }
  from {
    transform: rotate(-360deg);
  }
}

